import react, {FC, useState} from 'react'
import './container.css'
import logo from '../img/logo.png';
import Films from './films'
// import Characters from './characters'
// import Planets from './planets'



const Container:FC = () => {

    const [state, setState] = useState<String>('Films');

    return(
            <body>
                <header><img src={logo} alt="IMAGENSFERGV"/></header>
                <div className="Menu">
                    <div onClick={() => setState('Films')}><p>FILMS</p></div>
                    <div onClick={() => setState('Characters')}><p>CHARACTERS</p></div>
                    <div onClick={() => setState('Planets')}><p>PLANETS</p></div>
                </div>
                {state === 'Films' && <Films/>}

            </body>   
    );
}

export default Container;
